<script>
let defaultCenter = map.getCenter();
let defaultZoom = map.getZoom();

function highlightSector(id) {
    geo_json_87b1b73d4b5ddbc6c05d41d70c7eb4f6.eachLayer(function(layer) {
        let props = layer.feature.properties;
        let isSelected = layer.feature.id === id;

        if (isSelected) {
            layer.setStyle({
                color: 'red',
                weight: 3,
                dashArray: '6,4',
                fillColor: props.fill_color,
                fillOpacity: 0.6
            });
            map.fitBounds(layer.getBounds(), {padding: [20, 20]});
            layer.bringToFront();
        } else {
            layer.setStyle({
                color: '#BBBBBB',
                weight: 0.5,
                dashArray: '1,6',
                fillColor: '#F2F2F2',
                fillOpacity: 0.05
            });
        }
    });
}

function resetMap() {
    geo_json_87b1b73d4b5ddbc6c05d41d70c7eb4f6.eachLayer(function(layer) {
        let props = layer.feature.properties;
        layer.setStyle({
            color: 'black',
            weight: 1.5,
            dashArray: '0',
            fillColor: props.fill_color,
            fillOpacity: 0.6
        });
    });
    map.setView(defaultCenter, defaultZoom);
    document.getElementById("sectorDropdown").value = "";
}
</script>
